/* eslint-disable react/jsx-no-undef */
import React, { useState } from 'react'
import { Link, useNavigate } from "react-router-dom";
import Badge from "@material-ui/core/Badge";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import { useCart } from './ContextReducer';
import Modal from '../Modal';
import Cart from '../screens/Cart';
import styled from 'styled-components';
//clonzon 50

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #333;
  color: #fff;
  padding: 1rem;
`;

const NavItem = styled.li`
  list-style: none;
  margin: 0 1rem;

  a {
    color: #fff;
    text-decoration: none;
    transition: all 0.3s ease;

    &:hover {
      color: #bada55;
    }
  }
`;

const Logo = styled.h1`
  font-size: 1.5rem;
  margin: 0;
`;

const MobileNavToggle = styled.button`
  display: block;
  background-color: transparent;
  border: none;
  color: #fff;
  font-size: 1.5rem;
  cursor: pointer;
  transition: all 0.3s ease;

  &:hover {
    color: #bada55;
  }

  @media (min-width: 768px) {
    display: none;
  }
`;

const DesktopNav = styled.ul`
  display: flex;
  flex-direction: row;

  @media (max-width: 767px) {
    display: none;
  }
`;

const MobileNav = styled.ul`
  display: none;
  flex-direction: column;
  margin: 0;
  padding: 0;

  @media (max-width: 767px) {
    display: flex;
  }
`;

export default function Navbar(props) {

    const [isMobileNavOpen, setIsMobileNavOpen] = React.useState(false);
    const [cartView, setCartView] = useState(false)
    localStorage.setItem('temp', "first")
    let navigate = useNavigate();
    const handleLogout = () => {
        localStorage.removeItem('token')

        navigate("/login")
    }

    const loadCart = () => {
        setCartView(true)
    }

    const items = useCart();
    return (
        <div>
            <Nav>
                
                    <Logo><Link to="/">GetYourJewellery</Link></Logo>
                    <MobileNavToggle onClick={() => setIsMobileNavOpen(!isMobileNavOpen)}>{isMobileNavOpen ? 'Close' : 'Menu'}</MobileNavToggle>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <DesktopNav>
                        
                    <NavItem>
                                <Link to="/">Home</Link>  {/* index.css - nav-link color white */}
                            </NavItem>
                            <NavItem>
                                <Link to="/category">Categories</Link>  {/* index.css - nav-link color white */}
                            </NavItem>
                            
                            <NavItem>
                                <Link to="/nav1">Nav</Link>  {/* index.css - nav-link color white */}
                            </NavItem>

                            {(localStorage.getItem("token")) ?
                                <NavItem>
                                    <Link to="/myorder" >My Orders</Link>  {/* index.css - nav-link color white */}
                                </NavItem> : ""}
                        
                        {(!localStorage.getItem("token")) ?
                            <>
                            <NavItem><Link to="/login">Login</Link></NavItem>
                            <NavItem><Link to="/signup">Signup</Link></NavItem>
                            </>:
                            <div>
                              <NavItem>
                                <NavItem onClick={() => navigate("/cart")}>
                                    <Badge color="secondary" badgeContent={items.length} >
                                        <ShoppingCartIcon />
                                    </Badge>
                                    Cart
                                </NavItem>

                                {cartView ? <Modal onClose={() => setCartView(false)}><Cart></Cart></Modal> : ""}

                                <NavItem onClick={handleLogout}>Logout</NavItem></NavItem></div>}
                    </DesktopNav>
                
            </Nav>
        </div>
    )
}
